        public static Vector3D Sum(this IEnumerable<Vector3D> list)
        {
            Vector3D sum = new Vector3D(0, 0, 0);
            foreach (var v in list)
            {
                sum += v;
            }
            return sum;
        }
    }

    [Serializable()]
    [StructLayout(LayoutKind.Explicit)]
    public class Vector3D : IParseableString
    {
        [FieldOffset(0)]
        public float X;

        [FieldOffset(4)]
        public float Y;

        [FieldOffset(8)]
        public float Z;
        
        public float this[int key]
        {
            get
            {
                unsafe
                {
                    fixed (float* f = &this.X)
                    {
                        return f[key];
                    }
                }
            }
            set
            {
                unsafe
                {
                    fixed (float* f = &this.X)
                    {
                        f[key] = value;
                    }
                }
            }
        }

        public Vector3D() { } //Für den Serialiszer

        public Vector3D(Vector3D sourceObj)
        {
            X = sourceObj.X;
            Y = sourceObj.Y;
            Z = sourceObj.Z;
        }

        public Vector3D(float x, float y, float z)
        {
            if (float.IsNaN(x) || float.IsNaN(y) || float.IsNaN(z)) throw new Exception("Abnormal Error: Es sollte Vektorobjekt mit float-Parameter NaN erstellt werden " + x + " " + y + " " + z);
            if (float.IsInfinity(x) || float.IsInfinity(y) || float.IsInfinity(z)) throw new Exception("Abnormal Error: Es sollte Vektorobjekt mit float-Parameter IsInfinity erstellt werden " + x + " " + y + " " + z);
            this.X = x;
            this.Y = y;
            this.Z = z;
        }

        public Vector3D(Vector2D vec2D, float z)
            : this(vec2D.X, vec2D.Y, z)
        {
        }

        public Vector3D(float f)
            :this(f,f,f)
        {
        }

        public float[] Float3f
        {
            get { return new float[] { X, Y, Z }; }
        }

        //Der Json-Serialisierer schimpft rum, wenn ich es als Vector4D-Getter habe
        public Vector4D AsVector4D()
        {
            return new Vector4D(X, Y, Z, 1);
        }

        public Vector2D XY
        {
            get { return new Vector2D(X, Y); }
        }

        public override string ToString()
        {
            return "new Vector3D(" + X.ToString("G9").Replace(",", ".") + "f, " + Y.ToString("G9").Replace(",", ".") + "f, " + Z.ToString("G9").Replace(",", ".") + "f)";
        }

        public string ToCtorString()
        {
            return "new Vector3D(" + X.ToFloatString() + ", " + Y.ToFloatString() + ", " + Z.ToFloatString() + ")";
        }

        public string ToShortString()
        {
            return "[" + X.ToString("G9") + ";" + Y.ToString("G9") + ";" + Z.ToString("G9") + "]";
        }

        public static Vector3D Parse(string value)
        {
            var splits = value.Substring(1, value.Length - 2).Split(';');

            return new Vector3D(float.Parse(splits[0]),
                              float.Parse(splits[1]),
                              float.Parse(splits[2]));
        }

        //colorString = "#FF1277"
        public static Vector3D FromColorString(string colorString)
        {
            float r = int.Parse(colorString.Substring(1, 2), System.Globalization.NumberStyles.HexNumber) / 255.0f;
            float g = int.Parse(colorString.Substring(3, 2), System.Globalization.NumberStyles.HexNumber) / 255.0f;
            float b = int.Parse(colorString.Substring(5, 2), System.Globalization.NumberStyles.HexNumber) / 255.0f;
            return new Vector3D(r, g, b);
        }

        public override bool Equals(System.Object obj)
        {
            // If parameter is null return false.
            if (obj == null)
            {
                return false;
            }

            // If parameter cannot be cast to Point return false.
            if (!(obj is Vector3D p))
            {
                return false;
            }

            return X == p.X && Y == p.Y && Z == p.Z;
        }

        public override int GetHashCode()
        {
            return (int)X ^ (int)Y ^ (int)Z;
        }
        public static bool operator ==(Vector3D v1, Vector3D v2)
        {
            if (v1 is null && v2 is null) return true;
            if (v1 is null && v2 is object) return false;
            if (v1 is object && v2 is null) return false;
            return (v1.X == v2.X && v1.Y == v2.Y && v1.Z == v2.Z);
        }

        public static bool operator !=(Vector3D v1, Vector3D v2)
        {
            if (v1 is null && v2 is null) return false;
            if (v1 is null && v2 is object) return true;
            if (v1 is object && v2 is null) return true;
            return (v1.X != v2.X || v1.Y != v2.Y || v1.Z != v2.Z);
        }

        public static bool operator >=(Vector3D v1, Vector3D v2)
        {
            return (v1.X >= v2.X && v1.Y >= v2.Y && v1.Z >= v2.Z);
        }

        public static bool operator <=(Vector3D v1, Vector3D v2)
        {
            return (v1.X <= v2.X && v1.Y <= v2.Y && v1.Z <= v2.Z);
        }

        public static bool operator >(Vector3D v1, Vector3D v2)
        {
            return (v1.X > v2.X && v1.Y > v2.Y && v1.Z > v2.Z);
        }

        public static bool operator <(Vector3D v1, Vector3D v2)
        {
            return (v1.X < v2.X && v1.Y < v2.Y && v1.Z < v2.Z);
        }

