        //Rechte-Hand-Regel: v1 ist der Daum, v2 ist der Zeigefinger, Der Rückgabewert ist der Mittelfinger
        public static Vector3D Cross(Vector3D v1, Vector3D v2)
        {
            return new Vector3D(v1.Y * v2.Z - v2.Y * v1.Z, -v1.X * v2.Z + v2.X * v1.Z, v1.X * v2.Y - v2.X * v1.Y);
        }
        public static float AngleDegree(Vector3D v1, Vector3D v2) //Gradmaß
        {
            float f = (float)(Math.Acos((v1 * v2) / (v1.Length() * v2.Length())) * 180 / Math.PI);
            if (Single.IsNaN(f)) f = 0;
            return f;
        }
        public static float AngleRadians(Vector3D v1, Vector3D v2) //Bogenmaß
        {
            float f = (float)Math.Acos((v1 * v2) / (v1.Length() * v2.Length()));
            if (Single.IsNaN(f)) f = 0;
            return f;
        }

