        //Forschungen/2006--degreve--reflection_refraction.pdf -> Seite 6 Funktion "refract"
        //https://graphics.stanford.edu/courses/cs148-10-summer/docs/2006--degreve--reflection_refraction.pdf
        //i zeigt in die Richtung, aus der der Strahl kommt (Zeigt vom Brdf-Punkt weg)
        //n = Normale
        //i und n liegen auf der gleichen seite (i*n > 0)
        public static Vector3D GetRefractedDirection(Vector3D i, Vector3D n, float refractionIndexI, float refractionIndexO)
        {
            float η = refractionIndexI / refractionIndexO;
            float cosI = n * i;
            float sinT2 = η * η * (1 - cosI * cosI);
            if (sinT2 > 1) throw new Exception("In the case of total reflection, the beam cannot be refracted");
            float cosT = (float)Math.Sqrt(1 - sinT2);
            return η * (-i) + (η * cosI - cosT) * n;
        }

        //Forschungen/2006--degreve--reflection_refraction.pdf -> Seite 6 Funktion "reflectance"
        //Gibt an, wie viel Prozent des lichtes reflektiert wird (der Rest wird gebrochen)
        //directionToLight zeigt vom Brdf-Punkt weg; Achtung: directionToLight und normal MÜSSEN auf der gleichen Seite liegen!!! Sonst liefert die Funktion ein falschen Wert zurück
        public static double FresnelTerm(Vector3D directionToLight, Vector3D normal, float refractionIndexI, float refractionIndexO)
        {
            float η = refractionIndexI / refractionIndexO;
            float cosI = normal * directionToLight;
            float sinT2 = η * η * (1 - cosI * cosI);
            if (sinT2 > 1) return 1; //Totale Reflektion
            double cosT = Math.Sqrt(1 - sinT2);
            double rOrth = (refractionIndexI * cosI - refractionIndexO * cosT) / (refractionIndexI * cosI + refractionIndexO * cosT);
            double rPar = (refractionIndexO * cosI - refractionIndexI * cosT) / (refractionIndexO * cosI + refractionIndexI * cosT);
            return (rOrth * rOrth + rPar * rPar) * 0.5;
        }

        public static Vector3D GetRandomDirection(double u1, double u2)
        {
            //http://corysimon.github.io/articles/uniformdistn-on-sphere/   -> so sampelt man wirklich eine Kugel Uniform
            float phi = 2 * (float)(Math.PI * u1);
            float theta = (float)(Math.Acos(1 - 2 * u2));
            return new Vector3D((float)(Math.Cos(phi) * Math.Sin(theta)), (float)(Math.Sin(phi) * Math.Sin(theta)), (float)(Math.Cos(theta)));
        }

        public static Vector3D Projektion(Vector3D v1, Vector3D v2)//Projektziert v1 senkrecht auf v2
        {
            Vector3D ret = v2 * ((v1 * v2) / (v2 * v2));
            if (!float.IsNaN(ret.X) && !float.IsNaN(ret.Y)) return ret;
            return new Vector3D(0, 0, 0);
        }

        //wenn v länger als maxLength ist, dann wird es auf diese Länge begrenzt. Wenn es kürzer ist, wird nichts dran verändert
        public static Vector3D BoundLength(Vector3D v, float maxLength)
        {
            float length = v.Length();
            if (length < 0.01f) return v;
            float newLength = length;
            if (newLength > maxLength) newLength = maxLength;
            return (v / length) * newLength;
        }

        //Macht das gleiche wie Matrix.MatVMult(Matrix.GetNormalMatrix(new Vector3D(degreeX, degreeY, degreeZ)), V)
        public static Vector3D RotateVector(Vector3D V, float degreeX, float degreeY, float degreeZ)
        {
            Vector3D newV = new Vector3D(V);
            Vector3D v = new Vector3D(V);

            newV.X = (float)(v.X * Math.Cos(degreeZ * Math.PI / 180) - v.Y * Math.Sin(degreeZ * Math.PI / 180));
            newV.Y = (float)(v.X * Math.Sin(degreeZ * Math.PI / 180) + v.Y * Math.Cos(degreeZ * Math.PI / 180));
            v = new Vector3D(newV);

            newV.X = (float)(v.X * Math.Cos(-degreeY * Math.PI / 180) - v.Z * Math.Sin(-degreeY * Math.PI / 180));
            newV.Z = (float)(v.X * Math.Sin(-degreeY * Math.PI / 180) + v.Z * Math.Cos(-degreeY * Math.PI / 180));
            v = new Vector3D(newV);

            newV.Z = (float)(v.Z * Math.Cos(-degreeX * Math.PI / 180) - v.Y * Math.Sin(-degreeX * Math.PI / 180));
            newV.Y = (float)(v.Z * Math.Sin(-degreeX * Math.PI / 180) + v.Y * Math.Cos(-degreeX * Math.PI / 180));
            v = new Vector3D(newV);

            return v;
        }

        //Linke Hand Regel: Der Zeigefinger ist direction, axis ist der Daumen; Wenn win > 0, dann wird gegen die Uhr um den Daumen gedreht. Zeigefinger zeigt dann woander hin
        //Vektor direction wird um Vektor axis gedreht(axis ist senkrecht zu direction)(Dreh ähnlich wie Türklinke): Hinweis: axis muss senkrecht zu direction stehen
        public static Vector3D RotateVerticalDirectionAroundAxis(Vector3D direction, Vector3D axis, float angleDegree)
        {
            Vector3D R, W;
            R = Normalize(direction);
            W = Normalize(Cross(axis, direction));

            return R * (float)Math.Cos(angleDegree * Math.PI / 180) * direction.Length() + W * (float)Math.Sin(angleDegree * Math.PI / 180) * direction.Length();
            //return R * LookupCos(angleDegree * (float)Math.PI / 180) * direction.Length() + W * LookupSin(angleDegree * (float)Math.PI / 180) * direction.Length();
        }

        public static Vector3D RotateDirectionWhichIsNotVerticalToAxis(Vector3D direction, Vector3D axis, float angleDegree)
        {
            Vector3D p = Vector3D.Projektion(direction, axis);
            return p + Vector3D.RotateVerticalDirectionAroundAxis(direction - p, axis, angleDegree);
        }

        //Wie muss ich den Vektor (0,0,1) mit der Rotationsmatrix oder mit RotateVector drehen, um v1 zu erhalten?
        public static Vector3D GetAngularOrientationZ(Vector3D v1)
        {
            double phiX = Math.Atan2(-v1.Y, v1.Z); //phi = Wie viel Drehung um die X-Achse ist nötig?
            if (phiX < 0) phiX += 2 * Math.PI;
            var v1Y = Vector3D.RotateVector(v1, -(float)(phiX / 2 / Math.PI * 360), 0, 0); //Entferne aus v1 die X-Drehung. Jetzt bleibt nur noch die Y-Drehung

            double phiY = Math.Atan2(v1Y.X, v1Y.Z); //phi = WIe viel Drehung um die Y-Achse ist nötig?
            if (phiY < 0) phiY += 2 * Math.PI;

            return new Vector3D((float)(phiX / 2 / Math.PI * 360), (float)(phiY / 2 / Math.PI * 360), 0);
        }

        //Gibt den Ausrichtungsvektor V(WinX,WinY,WinZ) zurück. Wenn man V1 in der Reihenfolge WinX, WinY, WinZ dreht, zeigt er dann in die gleich Richtung wie V2
        //Hinweis: Die Winkelangaben des Ausrichtungsvektors(ReturnVektor) sind im Gradmaß und liegen im Bereich -90 bis +90
        //Laut dem UnitTest funktioniert diese Funktion hier nicht!
        public static Vector3D GetAngularOrientation(Vector3D V1, Vector3D V2)
        {
            float winX = 0, winY = 0;
            float winZ;
            if (Math.Abs(V2.Z) > 0.001f)
            {
                winX = AngleDegree(new Vector3D(0, V2.Y, V2.Z), V1);
                if (V2.Z < 0) winX = -winX;

                //if (winX >= 180) winX -= 180;
                //if (winX <= -180) winX += 180;
                if (winX > 90) winX -= 180;
                if (winX < -90) winX += 180;

                Vector3D rotVec = RotateVector(V1, winX, 0, 0);
                winZ = AngleDegree(rotVec, V2);
                if (V2.X > 0) winZ = -winZ;
            }
            else
            {
                winZ = AngleDegree(V1, V2);
                if (V2.X > 0) winZ = -winZ;
            }


            if (winX > 90) winX -= 180;
            if (winY > 90) winY -= 180;
            if (winZ > 90) winZ -= 180;
            if (winX < -90) winX += 180;
            if (winY < -90) winY += 180;
            if (winZ < -90) winZ += 180;

            //if (winX < 0) winX += 180;
            //if (winY < 0) winY += 180;
            //if (winZ < 0) winZ += 180;

            return new Vector3D(winX, winY, winZ);
        }

        //Hat man ein Längliches Objekt(Schwert), was mit den Ausrichtungsvektor V ausgerichtet wird, gibt diese Funktion
        //den Ausrichtungsvektor V' zurück, wodurch dann das Schwert andersrum ausgerichtet ist.
        public static Vector3D InvertAngularOrientation(Vector3D V)
        {
            Vector3D ret = new Vector3D(V);
            if (ret.Z != 0) { ret.Z += 180; return ret; }
            if (ret.Y != 0) { ret.Y += 180; return ret; }
            if (ret.X != 0) { ret.X += 180; return ret; }
            return ret;
        }

