        public static float LookupCos(float a)
        {
            var a1 = (int)(a * 1000);

            if (a1 >= 0)
                a1 %= CosLookup.Length;
            else
                a1 = CosLookup.Length - (-a1) % CosLookup.Length - 1;

            return CosLookup[a1];
        }

        public static float LookupSin(float a)
        {
            var a1 = (int)(a * 1000);

            if (a1 >= 0)
                a1 %= SinLookup.Length;
            else
                a1 = SinLookup.Length - (-a1) % SinLookup.Length - 1;

